import Link from 'next/link';
import { useState, useEffect } from 'react';

const Home = () => {
    const [title] = useState('Home');

    return (
        <>
            <div>
                {title}
            </div>
            <Link href="/">App</Link>
        </>
    );
};

export default Home;
